import styled from 'styled-components';

export const BannerContainer = styled.div`
	margin: 5rem auto;
	padding: 1rem 0;
	background-color: white;
`;

export const BottomContainer = styled.div`
	display: flex;
	margin: 3.5rem 0 1rem;
	justify-content: center;
`;
